import "./App.css";

function App() {
  const count = 0;

  let clickPlus = () => {
    count++;
    console.log(count);
  };

  return (
    <div className="App">
      <h2>Counter:</h2>
      <h1>{count}</h1>
      <button onClick={clickPlus}>Plus+</button>
      <button>Minus-</button>
    </div>
  );
}

export default App;
